import React from "react";
import {
    LoginWrapper,
    LoginBox,
    Input
} from "./login_style";

class Login extends React.Component{

    render(){
        return (
            <LoginWrapper>
                <LoginBox>
                    <h4 className="login-title">Login</h4>
                    <Input placeholder="account"></Input>
                    <Input placeholder="password"></Input>
                </LoginBox>
            </LoginWrapper>
        )
    }
}

export default Login;
